import './App.css';
import './Settings.css';
import './Profile.css';
import './Chat.css';
import './Login.css';
import user_img from './user.png';
import chats_img from './comment.png';
import setting_img from './settings.png';
import logout_img from './logout.png';
import { Chats } from './components/Chats';
import { ChatArea } from './components/ChatArea';
import { Settings } from './components/SettingsArea';
import { useState, useEffect } from 'react';
import axios from 'axios';
import { Profile } from './components/ProfileArea';

function App() {
    const [state, setState] = useState(1);
    const toggleTab = (index) => {
        setState(index);
    };

    const [form, setForm] = useState(1);
    const toggleForm = (index) => {
        setForm(index);
    };

    const [user, setUser] = useState(null);
    useEffect(() => {
        axios.get('http://localhost:8000/api/v1/Current/', { withCredentials: true })
            .then(response => {
                setUser(response.data);
            })
            .catch(error => {
                console.error(error);
            });
    }, []);

    const handleLogin = (e) => {
        e.preventDefault();
        const username = e.target.username.value;
        const password = e.target.password.value;
        axios.post('http://localhost:8000/api/v1/Login/', { username, password }, { withCredentials: true })
            .then(response => {
                setUser(response.data);
            })
            .catch(error => {
                console.error(error);
                alert('Ошибка при входе');
            });
    };

    const handleRegister = (e) => {
        e.preventDefault();
        const username = e.target.username.value;
        const email = e.target.email.value;
        const password = e.target.password.value;
        axios.post('http://localhost:8000/api/v1/Register/', { username, email, password }, { withCredentials: true })
            .then(response => {
                setUser(response.data);
            })
            .catch(error => {
                console.error(error);
                alert('Ошибка при регистрации');
            });
    };

    const handleLogout = () => {
        axios.post('http://localhost:8000/api/v1/Logout/', {}, { withCredentials: true })
            .then(response => {
                setUser(null);
            })
            .catch(error => {
                console.error(error);
            });
    };

    if (user) {
        return (
            <div className="application">
                <div className="nav">
                    <div className={state === 1 ? "nav_item_active" : "nav_item"} onClick={() => toggleTab(1)}>
                        <img src={user_img} alt=""/>
                        <span>Profile</span>
                    </div>
                    <div className={state === 2 ? "nav_item_active" : "nav_item"} onClick={() => toggleTab(2)}>
                        <img src={chats_img} alt=""/>
                        <span>Chats</span>
                    </div>
                    <div className={state === 3 ? "nav_item_active" : "nav_item"} onClick={() => toggleTab(3)}>
                        <img src={setting_img} alt=""/>
                        <span>Settings</span>
                    </div>
                    <div className="nav_item" onClick={handleLogout}>
                        <img src={logout_img} alt=""/>
                        <span>Log out</span>
                    </div>
                </div>
                <div className="main_content">
                    <div className="chat_wrapper">
                        <div className="main_area">
                            {state === 1 && <Profile/>}
                            {state === 2 && <ChatArea/>}
                            {state === 3 && <Settings/>}
                        </div>
                    </div>
                    <div className="another_menu">
                        <div className="chat_list">
                            <input type="text" placeholder="search"/>
                            <div className="chats">
                                <Chats/>
                            </div>
                        </div>
                    </div>
                </div>
            </div>
        );
    }
}

export default App;
